pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2; // Enable ABI Encoder V2 for handling complex data types like arrays

contract BlockLearning {
    address public owner;

    // Struct to store model updates and performance metrics
    struct Model {
        string modelHash;      // Hash of the model
        uint256 accuracy;      // Accuracy of the model
        uint256 timestamp;     // Timestamp of the update
        uint256 trainingSamples;  // Number of samples used in training
    }

    // Mapping to store model updates per client
    mapping(address => Model[]) public modelUpdates;
    mapping(address => bool) public registeredClients;

    // Event to log new model update
    event ModelUpdated(address indexed client, string modelHash, uint256 accuracy, uint256 timestamp, uint256 trainingSamples);

    constructor() public {
        owner = msg.sender;
    }

    // Register a new client
    function registerClient(address _client) public {
        require(msg.sender == owner, "Only the owner can register clients.");
        registeredClients[_client] = true;
    }

    // Function to update the model
    function updateModel(string memory _modelHash, uint256 _accuracy, uint256 _trainingSamples) public {
        require(registeredClients[msg.sender], "Client is not registered.");
        uint256 timestamp = now;  // Current timestamp
        modelUpdates[msg.sender].push(Model(_modelHash, _accuracy, timestamp, _trainingSamples));

        // Emit event for logging the update
        emit ModelUpdated(msg.sender, _modelHash, _accuracy, timestamp, _trainingSamples);
    }

    // Function to get model updates for a specific client
    function getModelUpdates(address _client) public view returns (string[] memory, uint256[] memory, uint256[] memory, uint256[] memory) {
        uint256 updateCount = modelUpdates[_client].length;
        string[] memory hashes = new string[](updateCount);
        uint256[] memory accuracies = new uint256[](updateCount);
        uint256[] memory timestamps = new uint256[](updateCount);
        uint256[] memory trainingSamples = new uint256[](updateCount);

        for (uint256 i = 0; i < updateCount; i++) {
            Model memory model = modelUpdates[_client][i];
            hashes[i] = model.modelHash;
            accuracies[i] = model.accuracy;
            timestamps[i] = model.timestamp;
            trainingSamples[i] = model.trainingSamples;
        }

        return (hashes, accuracies, timestamps, trainingSamples);
    }
}
